import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element and click to open cart modal
    // Try multiple selectors for cart: class .cart, text "Cart"
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear (look for cart modal or cart items)
    // Try to select by text "Your cart is empty" or class .cart-item or .cart-item-title
    // Wait for either empty cart or at least one cart item
    let cartHasItems = false;
    try {
      await page.waitForSelector('.cart-item', { timeout: 2000 });
      cartHasItems = true;
    } catch (e) {
      // No cart items found, check for empty cart
      await page.waitForSelector('.empty-cart', { timeout: 2000 });
    }

    // Take screenshot of cart modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    let removedItemTitle = null;
    let cartItemCountBefore = 0;
    let cartItemCountAfter = 0;

    if (cartHasItems) {
      // Count cart items before removal
      const cartItemsBefore = await page.$$('.cart-item');
      cartItemCountBefore = cartItemsBefore.length;

      // Get the title of the first cart item (for verification)
      const firstItemTitle = await cartItemsBefore[0].$eval('.cart-item-title', el => el.textContent.trim());
      removedItemTitle = firstItemTitle;

      // Click the first "Remove" button in the cart
      const removeBtn = await cartItemsBefore[0].$('button.remove-item');
      if (removeBtn) {
        await removeBtn.click();
      } else {
        throw new Error('Remove button not found for cart item');
      }

      // Wait for cart to update: either cart item count decreases, or "Your cart is empty" appears
      try {
        await page.waitForFunction(
          (prevCount) => {
            const items = document.querySelectorAll('.cart-item');
            return items.length < prevCount || document.querySelector('.empty-cart');
          },
          cartItemCountBefore,
          { timeout: 5000 }
        );
      } catch (e) {
        // Ignore, will check after
      }

      // Take screenshot after removal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_removal.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_after_removal.png'));

      // Count cart items after removal
      const cartItemsAfter = await page.$$('.cart-item');
      cartItemCountAfter = cartItemsAfter.length;
    } else {
      // Cart is empty, nothing to remove
      removedItemTitle = null;
      cartItemCountBefore = 0;
      cartItemCountAfter = 0;
    }

    // Extract cart status for verification
    let cartStatus = '';
    if (cartItemCountAfter === 0) {
      // Check if "Your cart is empty" is visible
      const emptyCartVisible = await page.$('.empty-cart');
      if (emptyCartVisible) {
        cartStatus = 'empty';
      }
    } else {
      cartStatus = 'has_items';
    }

    return {
      success: true,
      action: cartHasItems
        ? `Removed item "${removedItemTitle}" from cart`
        : "Cart was already empty, nothing to remove",
      extractedData: {
        removedItemTitle,
        cartItemCountBefore,
        cartItemCountAfter,
        cartStatus
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
